import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const InputTask = () => {
  return (
    <div className="card">
      <form>
        <div>
          <label htmlFor="inputTodo">Add Todo</label>
          <input type="submit" classname="btn btn-primary" />
        </div>
      </form>
    </div>
  );
};
export default InputTask;
